import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './component/App/App';
import Header from './component/Header/Header';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Header />
    <App />
		<script src="/Services/jquery.min.js"></script>
		<script src="/Services/jquery.poptrox.min.js"></script>
		<script src="/Services/browser.min.js"></script>
		<script src="/Services/breakpoints.min.js"></script>
		<script src="/Services/util.js"></script>
		<script src="/Services/main.js"></script>
  </React.StrictMode>
);
